import React from 'react';
import styled from 'styled-components';

const InfoSection = styled.div`
position: relative;
padding: 100px 0;
width: 100%;
height: 600px;

`;
const InfoContainer = styled.div`
width: 88%;
margin: 0 auto;
`;
const Heading = styled.div`
margin-top: 60px;
text-align: center;
font-size: 40px;
font-weight: 700;
`;
const RowOne = styled.h2``;
const InfoTitle = styled.h3``;
const ColLeft = styled.div``;
const InfoDescOne = styled.p``;
const ColRight = styled.div``;
const ImageLeft = styled.img``;

const Features = ({heading, pragraphOne, pragraphTwo, image}) => {
    return (
        <InfoSection>
            <InfoContainer>
                <Heading>Fantastisches neues Feature</Heading>
                <RowOne>
                    <ColLeft>
                        <InfoTitle>{ heading }</InfoTitle>
                        <InfoDescOne>{ pragraphOne }</InfoDescOne>
                        <InfoDescOne>{ pragraphTwo }</InfoDescOne>
                        <ImageLeft image={image} />
                    </ColLeft>
                    <ColRight>
                    </ColRight>
                </RowOne>
            </InfoContainer>
        </InfoSection>
    )
}

export default Features
